    "Design and Analysis of Metal-to-Composite Nozzle Extension Joints Project",nt"tracking_summary":
    {ntt"total": 9,ntt"recent": 2nt},nt"groups": [],nt"relationships_as_subject":
    [],nt"revision_timestamp": "2015-05-07T00:53:04.363713",nt"name": "design-and-analysis-of-metal-to-composite-nozzle-extension-joints-project",nt"isopen":
    true,nt"url": null,nt"notes": "As the operational demands of liquid rocket
    engines increases, so too does the need for improved design and manufacturing methods
    for metal-to-composite nozzle extensions. The state of the art utilizes non-domestic
    composite materials for nozzle extensions. Although this solution does offer weight
    savings and increased performance, there is an increase in cost and the addition
    of Export regulations. Within this effort, Materials Research &amp; Design (MR&amp;D)
    is proposing an analytical study, coupled with subcomponent fabrication and testing,
    that would result in a design for a domestically available C-C nozzle extension
    and metallic-to-composite joint for the J-2X. The proposed study would investigate
    various mechanical attachment methods, such as mechanical fasteners and adhesives
    for both the CMC-to-metallic joint and the CMC-to-CMC joint. Additional aspects
    of the trade study would investigate various flange shapes and materials in order
    to reduce the critical stresses in the region.  ",nt"license_title": "U.S.
